- input: "TEXT\x1CC00001917\x1CTEXT-00001\x1C\x1CF3XA\x1CThe Committee is in receipt
    of the Commission's letter dated April 8th, 2009 regarding the Amended 30 Day
    Post General Report filed on March 11, 2009.  1. The Committee reassigned a disbursement
    which occurred during the Pre General Reporting period.   2.  The Committee has
    filed an amended report for Pre General reporting period.  Upon further review
    after filing the original 30 Day Post General Report, the Committee discovered
    additional debts and receipts that had not originally been reported.  In order
    to be in full compliance, the Committee amended its report to include this information.
    3. The Commission notes transfers from the DCCC on Schedule A and Exempt Activity
    on Schedule B.  The Committee kept all funds transferred from the National Party
    Committees in a segregated account that was not used to fund exempt activity.
    \ 4. Schedule F now includes the appropriate candidate name and election period.
    \ 5. The Commission notes that there was a transaction on Schedule F that had
    a date after the election.  The Committee originally reported this transaction
    with the date paid and not the date disseminated. The Committee realized this
    was incorrect and has now reported with the appropriate date.  6. Schedule F has
    been amended to correct the candidate's year to date totals.   7. Payroll related
    items on Schedule H4 were for the benefit of employees that did not spend over
    25% of their compensated time on Federal activity.\n"
